import React, { useEffect, useState, useContext } from 'react';
import { NavLink } from 'react-router-dom';
import { AdminContext } from '../../App';

const DisplayAllMessages = () => {
    const [messages, setMessages] = useState([]);
    const { adminState, dispatchadmin } = useContext(AdminContext);

    useEffect(() => {
        fetch('/messages')
            .then((response) => response.json())
            .then((data) => setMessages(data))
            .catch((error) => console.error(error));
    }, []);

    const deleteMessage = (messageId) => {
        fetch(`/messages/${messageId}`, { method: 'DELETE' })
            .then((response) => response.json())
            .then((data) => {
                if (data.success) {
                    // If the message is successfully deleted, update the state to remove the deleted message
                    setMessages((prevMessages) =>
                        prevMessages.filter((message) => message._id !== messageId)
                    );
                }
            })
            .catch((error) => console.error(error));
    };

    const Loginbutton = () => {
        if (adminState) {
            return (
                <div>
                    <button className="logoutbtnDash">
                        <NavLink className="nav-link" to="/adminsignout">
                            logout
                        </NavLink>
                    </button>
                </div>
            );
        } else {
            return (
                <div>
                    <button className="logoutbtnDash">
                        <NavLink className="nav-link" to="/signin">
                            login
                        </NavLink>
                    </button>
                </div>
            );
        }
    };

    return (
        <div>
            <div className="sidebar">
                <div className="logo-details">
                    <i className=""></i>
                    <span className="logo_name1">Car</span>
                    <span className="logo_name">Rent</span>
                </div>
                <ul className="nav-links">
                    {/* Sidebar links */}
                </ul>
                <div className="logoutbtnDashDiv">
                    <Loginbutton />
                </div>
            </div>

            <section className="home-section">
                <nav>
                    <div className="sidebar-button">
                        <span className="dashboard">Dashboard</span>
                    </div>
                    <div className="profile-details">
                        <span className="admin_name">Admin</span>
                    </div>
                </nav>

                <div className="salecartableDiv">
                    <h1 className="heading">
                        <span>Users Messages</span>
                    </h1>

                    <table className="salecartable">
                        <thead>
                            <tr>
                                <th>NAME</th>
                                <th>EMAIL</th>
                                <th>PHONE</th>
                                <th>MESSAGE</th>
                                <th>DELETE</th>
                            </tr>
                        </thead>

                        <tbody>
                            {messages.map((message) => (
                                <tr key={message._id}>
                                    <td>{message.name}</td>
                                    <td>{message.email}</td>
                                    <td>{message.phone}</td>
                                    <td>{message.message}</td>
                                    <td>
                                        <button onClick={() => deleteMessage(message._id)}>
                                            Delete
                                        </button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </section>
        </div>
    );
};

export default DisplayAllMessages;
